import React from 'react';

const Movies = () => {
  const movies = [
    { id: 1, title: 'Inception', genre: 'Sci-Fi', releaseDate: '2010-07-16', price: '$5.99', amount: 10 },
    { id: 2, title: 'The Matrix', genre: 'Sci-Fi', releaseDate: '1999-03-31', price: '$3.99', amount: 5 },
  ];

  return (
    <div style={styles.container}>
      <h1>Movies List</h1>
      <button style={styles.createButton}>Create +</button>
      <table style={styles.table}>
        <thead>
          <tr>
            <th>ID</th>
            <th>Title</th>
            <th>Genre</th>
            <th>Release Date</th>
            <th>Price</th>
            <th>Amount</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {movies.map((movie) => (
            <tr key={movie.id}>
              <td>{movie.id}</td>
              <td>{movie.title}</td>
              <td>{movie.genre}</td>
              <td>{movie.releaseDate}</td>
              <td>{movie.price}</td>
              <td>{movie.amount}</td>
              <td>
                <button style={styles.actionButton}>Read</button>
                <button style={styles.actionButton}>Edit</button>
                <button style={styles.deleteButton}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
  },
  createButton: {
    backgroundColor: 'green',
    color: 'white',
    padding: '10px 20px',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    marginBottom: '20px',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
  },
  actionButton: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '5px 10px',
    marginRight: '5px',
    border: 'none',
    borderRadius: '3px',
    cursor: 'pointer',
  },
  deleteButton: {
    backgroundColor: '#dc3545',
    color: 'white',
    padding: '5px 10px',
    border: 'none',
    borderRadius: '3px',
    cursor: 'pointer',
  },
};

export default Movies;
